import React from "react";
import "./styles.scss";

export function Box() {
  return (
    <div className="container">
      <div className="box">
        <div className="box__circle">
          <img
            src={require("../../assets/images/icon-brand-recognition/svg")}
          />
        </div>
      </div>
    </div>
  );
}
